import { useState, useEffect } from 'react';
import axios from 'axios';

function App() {


  const [getNotes, setNotes] = useState(['yeah..'])

  useEffect(() => {
    axios.get(`https://restcountries.com/v3.1/all`).then((response) => {
      let grab = [response.data];
      setNotes(grab);
      for (let countryObject of getNotes[0]) {
        console.log(countryObject)
      }
      return;
    }).catch((error) => {
      console.log(`did not receive shieeet at response ${error}`)
    })
  }, [])

  useEffect(() => { console.log('entering use effect') }, [])
  return (
    <>
      <>
        <h1>Work in Progress!</h1>
      </>
      <>
        <span>{'testing'}</span>
      </>
    </>
  )
}


export default App;
